B.S4=new A.fz("Bitte erz\xe4hle uns \xfcber Dich und Dein Zuhause.",null)
B.TR=new A.eK("Ich bin Lilli, 39 Jahre alt und arbeite bei einem der letzten familiengef\xfchrten M\xf6belunternehmen in Deutschland. Ich denke gerne kreativ und mag es grenzen \xfcbergreifende Strategien zu entwickeln. Wir, das sind mein Mann, unsere beiden T\xf6chter und ich, leben in Bielefeld in einem historischem Gewerbepark in einem Loft auf 100 Quadratmetern. Es ist alles offen, bis auf das Zimmer unserer \xe4ltesten Tochter. Wir lieben die H\xf6he in der Mitte des Raums, die f\xfcr viel \u201eFreiheit\u201c sorgt. Es gibt aber auch auf der ganzen Rauml\xe4nge auf beiden Seiten Dachschr\xe4gen, die dem Raum kuschelige Gem\xfctlichkeit verleihen. Lange (10 Jahre) haben wir davon getr\xe4umt so zu wohnen und sind jetzt mega happy.",null)
B.RY=new A.fz("Welche Aspekte verleihen Deinem Zuhause Wohlf\xfchlatmosph\xe4re?",null)
B.TV=new A.eK("F\xfcr uns bedeutet Wohlf\xfchlatmosph\xe4re Luft zum Atmen, daher ist die Raummitte frei, um mit Leben bespielt zu werden. Wir haben wenig M\xf6bel \u2013 die alle funktional und mit viel Liebe ausgew\xe4hlt sind - aber einige sch\xf6ne, farbenfrohe Wohnaccessoires und Objekte, die unser Zuhause \u201ebesonders\u201c machen. Ich mag es, wenn man sieht, wer darin wohnt.",null)
B.S0=new A.fz("Wie gehst Du an Raumgestaltung heran?",null)
B.TK=new A.eK("Ich richte selten R\xe4ume ein. In unserem Loft wohnen wir jetzt schon fast 10 Jahre und hier hat sich in der groben Struktur wenig getan. Am Anfang haben wir den Raum nach unseren Bed\xfcrfnissen und Needs in Bereiche geordnet und geschaut welche M\xf6bel wir wo platzieren um den Bereichen einen Rahmen zu geben, die Leichtigkeit und Offenheit des Raums aber nicht kaputt zu machen. Ein Bad, eine K\xfcche, ein Esstisch mit St\xfchlen, Bett und Schrank, ein niedriges Regal passend zu unserer Architektur. Es gibt bei uns wenig M\xf6glichkeiten M\xf6bel zu verr\xfccken oder Bereiche zu tauschen. Ich glaube wir haben f\xfcr unsere Wohnsituation mit den Anforderungen von vier Personen die beste L\xf6sung gefunden.",null)
B.S1=new A.fz("Was darf in einem Raum f\xfcr Dich nicht fehlen?",null)
B.TJ=new A.eK("Die pers\xf6nliche Note. Ich mag es, wenn ein Zuhause individuell ist, w\xe4chst und sich ver\xe4ndert und Geschichten \xfcber die Bewohner erz\xe4hlt. Es muss niemandem gefallen, au\xdfer den Menschen, die darin zuhause sind. Ich pers\xf6nlich mag Farbe sehr. Die bringt Fr\xf6hlichkeit in jeden Raum und tut meinem Wohlbefinden gut.",null)
