B.RZ=new A.fz("Welche Rolle spielt Raumfarbe f\xfcr Dich?",null)
B.TX=new A.eK("Wie eben schon erw\xe4hnt: Ich liebe Farbe! Aaaaaber unser Boden ist lichtgrau und unsere W\xe4nde sind fast \xfcberall wei\xdf. Die einzige farbige Wand, findet man bei uns im Bad. Die wei\xdfen W\xe4nde und der lichtgraue Holzboden bieten aber unseren farbenfrohen Dekoaccessoires, Designobjekten und der Kunst an der Wand die perfekte B\xfchne. So k\xf6nnen unsere besonderen St\xfccke mehr Aufmerksamkeit auf sich ziehen. Au\xdferdem wird durch die Farb-Unterbrechung ein harmonisches Gleichgewicht zwischen Ruhe und Spannung gehalten.",null)
B.S3=new A.fz("Du wohnst nicht allein. Wie bekommst Du alle W\xfcnsche unter einen Hut?",null)
B.U_=new A.eK("Jeder darf seine W\xfcnsche \xe4u\xdfern. Damit es am Ende nicht zu wild wird \u2013 bei uns sind ja (fast) alle Bereiche auf einen Blick einsehbar - geben wir unseren T\xf6chtern gerne eine Auswahl vor und lenken so in die \u201erichtige\u201c Richtung. Im Zimmer unserer Gro\xdfen, hat sie nat\xfcrlich den Hut auf und die Kleine darf sich in ihren Tiny-Kinderhaus ausleben. Die gro\xdfen Einrichtungsentscheidungen liegen zu 50% bei meinem Mann Sascha und zu 50% bei mir. Wir k\xf6nnen uns da gut die B\xe4lle zuspielen und finden immer einen guten Kompromiss. W\xfcrde ich allein entscheiden, w\xe4re es wahrscheinlich weicher, femininer - w\xfcrde er alleine entscheiden w\xe4re es artify, verr\xfcckter und vielleicht minimalistischer. So wie es ist, k\xf6nnen wir beide sehr gut damit leben. :)",null)
